<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Grasslands.html</title>
</head>
<body>

<script>
//>>built
define("dojox/charting/themes/Grasslands", ["../Theme", "./common"], function(Theme){
	
	//	notes: colors generated by moving in 30 degree increments around the hue circle,
	//		at 90% saturation, using a B value of 75 (HSB model).
	dojox.charting.themes.Grasslands=new Theme({
		colors: [
			"#70803a",
			"#dde574",
			"#788062",
			"#b1cc5d",
			"#eff2c2"
		]
	});
	
	return dojox.charting.themes.Grasslands;
});

</script>

</body>
</html>
